function Register() {
    return ( 
        <form style={{maxWidth: "30rem"}} className="mx-auto mt-5">
            <h2 className="text-center">Register</h2>
            <div className="mb-3">
                <label htmlFor="exampleInputEmail1" className="form-label">Username</label>
                <input type="text" className="form-control" name="username" id="exampleInputEmail1" aria-describedby="emailHelp" required  autoComplete="current-password"/>
                <div id="emailHelp" className="form-text">We'll never share your username with anyone else.</div>
            </div>
            <div className="mb-3">
                <label htmlFor="exampleInputPassword1" className="form-label">Password</label>
                <input type="password" name="password" className="form-control" id="exampleInputPassword1" required autoComplete="current-password"/>
            </div>
            <button type="submit" className="btn btn-success">Register</button>
        </form>
     );
}

export default Register;
